import React from "react";
import periodicTables from "./periodicTables.png";
import weLoveMovies from "./weLoveMovies.png";

function Projects() {
  return (
    <div className="breathe">
      <h2 id="projects">My Babies</h2>
      <div className="row">
        <div className="column2">
          <div className="polaroid">
            <div className="container2">
              <img
                style={{
                  width: "100%",
                  borderRadius: "5px",
                  maxHeight: "250px",
                }}
                src={periodicTables}
              />
              <div className="overlay">
                <div className="text">
                  <h4>PeriodicTables</h4>
                  <p>"A restaurant reservation system"</p>
                  <p>React, CSS, Express, Knex, PostgreSQL.</p>
                </div>
              </div>
            </div>
            <div className="container">
              <p>GitHub Repo</p>
            </div>
          </div>
        </div>
        <div className="column2">
          <div className="polaroid">
            <div className="container2">
              <img
                style={{
                  width: "100%",
                  borderRadius: "5px",
                  maxHeight: "250px",
                }}
                src={weLoveMovies}
              />
              <div className="overlay">
                <div className="text">
                  <h4>WeLoveMovies</h4>
                </div>
              </div>
            </div>
            <div className="container">
              <p>GitHub Repo</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Projects;

